import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import sair from './sair.svg';

class Informacao extends Component {
    static n = 0;
    constructor(props) {
        super(props);


    }

    _fechar(){
        console.log('fechar')
        this.props.InformacaoCategoria(false)
    }
    render() {
        console.log('this.props no info',this.props)
        let i = this.props.info
        if(!i){
            return (null)
        }
        else if(i=='idh'){

            return(
               <section className="pop">
                    <img src={sair} onClick={(x)=> this._fechar()} className='botaoFechar'></img>
                    <p className='categoria'>IDH - Índice de Desenvolvimento Humano</p>
                    <p className='vencedor'>Ganha o maior número entre 0 e 1</p>
                    <p className='explicacao'>o idh ba bsadnjk sndds dnas dsad da das fagasn jga </p>

               </section>
                          
            )
        }
        else if(i=='exp'){
            return(
                <section className="pop">
                <p className='categoria'>Expectativa de vida <img src={sair} onClick={(x)=> this._fechar()} className='botaoFechar'></img></p>
                <p className='vencedor'>Ganha o maior número</p>
                <p className='explicacao'>O índice é referente a expectativa de anos que uma pessoa viverá </p>

           </section> 
            )
        }
        else{
            return(null)
        }
    }
}

export default Informacao;

